import React from 'react';
import ReactDom from 'react-dom';
import './index.css';
import Card from './Card';
import 'tachyons';
import { robots } from './robots';

ReactDom.render (
    <div>
        <Card  id={robots[0].id} name={robots[0].name} email={robots[0].email}/>
        <Card />
        <Card />
    </div>

, document.getElementById('root'));
